      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 + 0 BETWEEN - col0 AND - + col1 * 26 + - + col1 + + 22 * - - col1;
  - name: tab2

outputs:
